import React from 'react';

import './Navbar.css';
import { Link } from 'react-router-dom';

const Navbar = () => (
  <div className='cv__navbar'>
    <div className='cv__navbar-heading'>
      <div className='cv__navbar-heading_square'></div>
      <div className='cv__navbar-heading'></div>
      <Link to='/'>
        <h2>Alok Awasthi</h2>
        <p> / Software Developer</p>
      </Link>
    </div>
  </div>
);

export default Navbar;
